import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SearchDataService {

  constructor() { }
  searchText: string = ""

  searchData(data: string) {
    this.searchText = data
    console.log(this.searchText)
  }
}
